INSERT INTO `eye_article` VALUES ('16', 'ped', '', '1036032', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/pxsvuuc2vljbt51cq6wp.jpg', null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/taddq3rcjl7d4msg1ey7.gif\" alt=\"\" width=\"418\" height=\"611\" /></p>', '4', '佚名', '0', null, '2020-10-10 10:27:57', '2020-10-30 11:14:09', '0'), ('18', 'SGS', '', '1036032', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/pxsvuuc2vljbt51cq6wp.jpg', null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/x0lf7f8jsyj2rgw7y049.jpg\" /></p>', '4', '佚名', '0', null, '2020-10-10 10:29:09', '2020-10-10 10:29:09', '0'), ('19', 'CE3', '', '1036032', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/pxsvuuc2vljbt51cq6wp.jpg', null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/jofqgbcrm633b5lgmjjj.jpg\" /></p>', '4', '佚名', '0', null, '2020-10-10 10:30:04', '2020-10-10 10:30:04', '0'), ('20', 'CED', '', '1036032', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/pxsvuuc2vljbt51cq6wp.jpg', null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/cea00zgei4dflb0grtr3.jpg\" /></p>', '4', '佚名', '0', null, '2020-10-10 10:30:27', '2020-10-10 10:30:27', '0'), ('21', 'occupational health', '', '1036032', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/pxsvuuc2vljbt51cq6wp.jpg', null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/oizzpyb7m0f6h545l1bx.jpg\" /></p>', '4', '佚名', '0', null, '2020-10-10 10:31:31', '2020-10-10 10:31:31', '0'), ('31', 'UI设计其实很简单：Photoshop界面设计高手之道', 'UI设计其实很简单：Photoshop界面设计高手之道', '1036034', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/w55bpedgte19oupqjqta.png', 'UI设计', '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/geao95cquamgh36a8l1p.jpg\" alt=\"\" width=\"750\" height=\"6408\" /></p>', '3', '佚名', '1', '/productDetail?id=', '2020-10-15 10:54:52', '2020-10-15 10:55:57', '0'), ('32', 'Java从入门到精通（第5版）', 'Java从入门到精通（第5版）', '1036033', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/gmav57f2nkw6is90t86r.jpg', 'java,首页', '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/7rw464xlbvsjvq5w719v.jpg\" alt=\"\" width=\"700\" height=\"10027\" /></p>', '1', '佚名', '1', '/productDetail?id=', '2020-10-15 10:57:29', '2020-10-15 14:22:20', '0'), ('33', 'Java核心技术 卷I 基础知识（原书第11版）', 'Java核心技术 卷I 基础知识（原书第11版）', '1036033', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/rqwoulwhi16ziyin79q5.png', 'java,首页', '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/5vy2va4fry9ise120cm1.jpg\" alt=\"\" width=\"750\" height=\"7257\" /></p>', '1', '佚名', '1', '/productDetail?id=', '2020-10-15 10:59:25', '2020-10-15 14:22:38', '0'), ('34', 'Python基础教程（第3版）', 'Python基础教程（第3版）', '1036038', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/lg1mljc6e7n9f7448uxk.png', 'python', '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/saijl6od0ee3a5ck8x3n.jpg\" alt=\"\" width=\"750\" height=\"4768\" /></p>', '2', '佚名', '1', '/productDetail?id=', '2020-10-15 11:03:08', '2020-10-15 11:06:13', '0'), ('35', 'Python学习手册（原书第5版）', 'Python学习手册（原书第5版）', '1036038', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/urwlaezznzdyzby15519.png', 'python', '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/vvbm2jhgjf33vgp5ub53.jpg\" alt=\"\" width=\"750\" height=\"2955\" /></p>\n<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/vvbm2jhgjf33vgp5ub53.jpg\" alt=\"\" width=\"750\" height=\"2955\" /></p>', '2', '佚名', '1', '/productDetail?id=', '2020-10-15 11:11:09', '2020-10-15 11:12:09', '0'), ('37', '网店运营管理与营销推广', '网店运营管理与营销推广', '1036044', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/zudt0ajh676ip97t3awz.png', '运维', '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/61ixaxavewyztt8mdhgb.jpg\" alt=\"\" width=\"790\" height=\"3699\" /></p>', '8', '佚名', '1', '/productDetail?id=', '2020-10-15 11:15:22', '2020-10-15 11:16:11', '0'), ('39', '招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！', '浪博科技招生啦', '1036029', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/7ei0yjwzem4lvwgh4ocv.jpg', null, '<p>&nbsp; &nbsp;经历了近8个月的疫情待工待学，河南浪博科技终于开启了新的一年招生进程！</p>\n<p><strong>为家长解决教育难题，为学生提供明朗前景！</strong></p>\n<p><img class=\"alignnone size-full wp-image-1480\" title=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图\" src=\"https://www.hotwp.net/wp-content/uploads/2020/07/32.png\" alt=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图\" width=\"471\" height=\"255\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; 2020年已过一半，全国还有大批高校仍未开学，仓促的毕业生失去了半年实习机会懵懂的一头撞进社会的历练里。</p>\n<p>不知所措的毕业，那么就业就成了难题。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img class=\"alignnone size-full wp-image-1481\" title=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图(1)\" src=\"https://www.hotwp.net/wp-content/uploads/2020/07/594bf51831a84d0cbb42a4554086047d_th.png\" sizes=\"(max-width: 540px) 100vw, 540px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/07/594bf51831a84d0cbb42a4554086047d_th.png 540w, https://www.hotwp.net/wp-content/uploads/2020/07/594bf51831a84d0cbb42a4554086047d_th-480x329.png 480w\" alt=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图(1)\" width=\"540\" height=\"370\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>找工作真的那么困难吗？浪博告诉你，并不是。<strong>校企合作，针对性就学。</strong></p>\n<p><strong>&nbsp;</strong></p>\n<p>让上学不止是浑浑噩噩的荒废几年最珍贵的青春时光，而是让自己有一技之长。</p>\n<p>俗话说，身有一技走遍天下。我们的招生，更专注于找寻人才，为国家培养人才。</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; &nbsp;今年，浪博科技与开封市信息工程学校达成合作，成立三年制度的互联网培优班。</p>\n<p>让就学为了就业服务，毕业以后由企业人资评估引导就业岗位。</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;<strong>&nbsp;UI设计师培训班 &nbsp;</strong></p>\n<p><strong>&nbsp; Java编程工程师培训班&nbsp;&nbsp;</strong></p>\n<p>&nbsp;</p>\n<div>&nbsp;</div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;两大板块同步进行，让学生毕业以后就成为互联网高级技术人员。</p>\n<p><strong>执行开封地区人才计划，为开封周边地区培养输送互联网人才，毕业之后可以为政府服务。</strong></p>\n<p><strong>校企合作，毕业以后也可以回企业就职，你可以成为软件研发人员，也可以成为技术培训老师。</strong></p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; 前两年在学校里学习，第三年回企业国家计算机应用与软件技术实训基地实习。</p>\n<p>不仅是单薄的课本知识，更是实际操作的教学方式，我们有着河南省内最大服务器机房，多媒体P2户内显示屏教室。</p>\n<p>无论是教学环境还是师资力量都是求学实训的好去处。</p>\n<p>&nbsp;</p>\n<p>&nbsp; &nbsp; 此次招生年龄在初中毕业后即可，如果你无心在数理化政史地中成长，不如来学习一门受用一生的技术。</p>\n<p><strong>只要你想有一技之长，就快来报名吧！</strong></p>\n<p>&nbsp;</p>\n<h1><strong>&nbsp; 招生简章&nbsp;&nbsp;</strong></h1>\n<p><strong>&nbsp;</strong></p>\n<p>&nbsp;</p>\n<div><img class=\"alignnone size-medium wp-image-1482\" title=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图(2)\" src=\"https://www.hotwp.net/wp-content/uploads/2020/07/%E6%8B%9B%E7%94%9F1-339x480.jpg\" sizes=\"(max-width: 339px) 100vw, 339px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/07/招生1-339x480.jpg 339w, https://www.hotwp.net/wp-content/uploads/2020/07/招生1-768x1086.jpg 768w\" alt=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图(2)\" width=\"339\" height=\"480\" /></div>\n<p><img class=\"alignnone size-medium wp-image-1483\" title=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图(3)\" src=\"https://www.hotwp.net/wp-content/uploads/2020/07/%E6%8B%9B%E7%94%9F2-339x480.jpg\" sizes=\"(max-width: 339px) 100vw, 339px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/07/招生2-339x480.jpg 339w, https://www.hotwp.net/wp-content/uploads/2020/07/招生2-768x1086.jpg 768w\" alt=\"招生啦！浪博科技联合开封市信息工程学校，校企合作就学等于就业！插图(3)\" width=\"339\" height=\"480\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>招生热线：</p>\n<p>18003787940 &nbsp; &nbsp; 13393824400</p>\n<p>&nbsp;</p>\n<p>企业地址：河南开封 中关村智酷人才与产业创新基地6楼 河南浪博电子开发有限公司</p>\n<p>&nbsp;</p>\n<p>学校地址：开封市内环南路8号（原开封三职专） 开封市信息工程学校</p>', '1', '佚名', '1', '/newsDetail?id=', '2020-10-15 15:12:33', '2020-10-30 09:22:55', '0'), ('40', '河南浪博科技集团与中国翰园达成景区官网建设合作协议', '', '1036029', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/zj36kvlwee95r4onl20r.jpg', null, '<p>近日浪博集团相关领导正式和中国翰园相关市场负责人肖总会面，双方就中国翰园官方网站建设一事进行了详细的沟通、交流！最终达成合作协议，并将网站交由浪博集团托管。中国翰园官网鉴赏地址：http://www.hanyuan.cc/</p>\n<p>&nbsp;</p>\n<p>中国翰园位于开封市龙亭湖风景区西北隅，是<a href=\"https://www.hotwp.net/go?_=05ea7f5aa2aHR0cHM6Ly9iYWlrZS5iYWlkdS5jb20vaXRlbS8lRTYlOUQlOEUlRTUlODUlQUMlRTYlQjYlOUIvOTUwOTAxNw==\" target=\"_blank\" rel=\"noopener noreferrer\">李公涛</a>先生带领全家自筹资金发起创建的一座融山水艺术景观和古典园林建筑艺术为一体，集古今中外诗词、书画、碑刻艺术之大成的文化园林，园区占地120亩，南部为园林风景区，北部为碑刻展示区，展出书画碑刻3800余块，长达六华里的碑廊以朝代为序，镶嵌了历代书法名家的代表碑帖，同时以书体分镶的现代碑廊全面展示了现当代书法大家的艺术风采，被评为&ldquo;河南省文化旅游先进单位&rdquo;、&ldquo;河南省文化产业示范基地&rdquo;和&ldquo;<a href=\"https://www.hotwp.net/go?_=d2954d95caaHR0cHM6Ly9iYWlrZS5iYWlkdS5jb20vaXRlbS8lRTUlOUIlQkQlRTUlQUUlQjZBQUFBJUU3JUJBJUE3JUU2JTk3JTg1JUU2JUI4JUI4JUU2JTk5JUFGJUU1JThDJUJB\" target=\"_blank\" rel=\"noopener noreferrer\">国家AAAA级旅游景区</a>&rdquo;，并获&ldquo;中国驰名商标&rdquo;。</p>\n<p>&nbsp;</p>\n<p><a href=\"https://www.hotwp.net/go?_=c18a25b98caHR0cDovL3d3dy5ob3R3cC5uZXQ=\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"alignnone size-medium wp-image-1456\" title=\"河南浪博科技集团与中国翰园达成景区官网建设合作协议插图\" src=\"https://www.hotwp.net/wp-content/uploads/2020/03/1585646679-298x480.png\" sizes=\"(max-width: 298px) 100vw, 298px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/03/1585646679-298x480.png 298w, https://www.hotwp.net/wp-content/uploads/2020/03/1585646679-768x1238.png 768w\" alt=\"河南浪博科技集团与中国翰园达成景区官网建设合作协议插图\" width=\"298\" height=\"480\" /></a></p>\n<p>&nbsp;</p>\n<p><strong>河南浪博电子科技开发有限公司，专注<a href=\"https://www.hotwp.net/go?_=c18a25b98caHR0cDovL3d3dy5ob3R3cC5uZXQ=\" target=\"_blank\" rel=\"noopener noreferrer\">河南企业网站建设</a>，拥有多年的建站经验；另有多套成品网站供您挑选，是您软件开发合作的最佳</strong><strong>选择！浪博全员竭诚欢迎您的到来，期待与您的长期合作！</strong></p>', '2', '佚名', '1', '/newsDetail?id=', '2020-10-15 15:14:18', '2020-10-30 10:08:41', '0'), ('41', '河南浪博科技集团股份有限公司', '', '1036026', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/vti8zniywziwbv74qh7t.jpg', null, '<div class=\"container\">\n<div class=\"row\">\n<div class=\"col-lg-6\"><img src=\"https://www.hotwp.net/wp-content/uploads/2019/07/1.jpg\" alt=\"\" /></div>\n<div class=\"col-lg-6\">\n<article>\n<p class=\"ti2em\">浪博集团公司成立于2019年（前身为河南浪博电子科技开发有限公司），集团公司注册资金1500万元，在职技术人员60余人,主要致力于企业、政府以及个体工商户的网络化管理产品的研发、促进提升企业经营外在形象、信息化、网络化管理为一体的网络科技公司。我们是一家专注用户体验设计与互联网品牌建设的设计公司，创立至今为多位客户提供了创新与专业的设计方案。设计服务范围包括：交互原型设计、产品视觉设计、网站设计与开发建设、移动及软件产品界面设计、图标设计、品牌及平面设计等。我们的价值与宗旨是为用户和客户打造最nice的设计，用设计提升产品和企业价值。</p>\n<p class=\"ti2em\">公司专精于高品质多媒体互动制作的全方位设计类型公司，同时也拥有100多名实力坚强的研发团队人员及有素养的设计专才，河南浪博电子科技开发有限公司一直致力于建立更多更好的互联网品牌形象，提供权威专业的互联网品牌策划，并实施高标准的设计方案，创造真正意义上的品牌网站，为互联网品牌在互动领域创造大价值而不懈努力。</p>\n浪博集团秉承&ldquo;没有挑剔的客户，只有待完善产品&rdquo;的做事理念，立足中原服务全国，先后为全国各地上万家企业、政府以及个体工商户提供软件开发及技术咨询服务！如您在企业发展中有需要软件开发类型帮助，请与我们联系！浪博集团全体员工竭诚欢迎您的来访，期待与您携手共进、合作共赢！</article>\n</div>\n</div>\n</div>\n<div class=\"about-team\">\n<div class=\"container\">\n<h2 class=\"text-center service-h\">我们的团队<br /><small>Service Process</small></h2>\n<div class=\"text-center\">我们是一支专业的团队。我们的团队成员拥有多年网站与app开发经验背景,曾在国内知名网络公司任职,有丰富的软件开发经验，我们的责任心更强，技术服务更加周到。 我们是一支创新的团队。我们将设计通过情感表达把用户产品连接在一起，让用户享受使用产品的愉悦。通过交互设计展现出来，用一个充满情感化的设计打动用户。 我们是一只敢于实践的团队，虽然我们来自五湖四海，毕业于不同的高校；但我们怀揣着一个共同目标，有着一个共同梦想，为伟大祖国互联网突飞猛进的发展贡献出自己的一份力量。 &nbsp;</div>\n</div>\n</div>', '3', '佚名', '1', null, '2020-10-15 15:15:58', '2020-10-30 10:09:02', '0'), ('42', 'WordPress主题网站——将后台新闻发布链接由汉字类型转变为普通链接方法', 'WordPress主题网站', '1036029', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/fr0edaav0pba7d4gwvu8.jpg', null, '<p>对于我们经常使用WordPress网站后台管理人员来讲，可能很多人都遇到过新闻发布时候，下面链接是汉字的情况，而且通常这个链接中的汉字还是新闻的标题。尽管这样的做法对于我们网站的优化不影响，但就是会让我们看着不爽；然而作为非技术人员的管理者，又不知道该如何更改这样的链接，今天浪博科技小编就图文教程来教大家设置下吧！</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><a href=\"https://www.hotwp.net/archives/lb-wordpress-news/www.hotwp.net\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"alignnone size-medium wp-image-1413\" title=\"WordPress主题网站&mdash;&mdash;将后台新闻发布链接由汉字类型转变为普通链接方法插图\" src=\"https://www.hotwp.net/wp-content/uploads/2020/03/15853638151-480x317.png\" sizes=\"(max-width: 480px) 100vw, 480px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/03/15853638151-480x317.png 480w, https://www.hotwp.net/wp-content/uploads/2020/03/15853638151-768x507.png 768w, https://www.hotwp.net/wp-content/uploads/2020/03/15853638151.png 1285w\" alt=\"WordPress主题网站&mdash;&mdash;将后台新闻发布链接由汉字类型转变为普通链接方法插图\" width=\"480\" height=\"317\" /></a></p>\n<p>文字链接情况</p>\n<p>&nbsp;</p>\n<blockquote>\n<p>第一步：打开我们的WordPress网站管理后台，点击设置，找到固定链接选项，出现下面图片：</p>\n<p><a href=\"https://www.hotwp.net/archives/lb-wordpress-news/www.hotwp.net\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"alignnone size-medium wp-image-1414\" title=\"WordPress主题网站&mdash;&mdash;将后台新闻发布链接由汉字类型转变为普通链接方法插图(1)\" src=\"https://www.hotwp.net/wp-content/uploads/2020/03/15853639641-471x480.png\" sizes=\"(max-width: 471px) 100vw, 471px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/03/15853639641-471x480.png 471w, https://www.hotwp.net/wp-content/uploads/2020/03/15853639641-768x782.png 768w, https://www.hotwp.net/wp-content/uploads/2020/03/15853639641.png 906w\" alt=\"WordPress主题网站&mdash;&mdash;将后台新闻发布链接由汉字类型转变为普通链接方法插图(1)\" width=\"471\" height=\"480\" /></a></p>\n<p>&nbsp;</p>\n<p>第二步：选择固定链接中的数字型，将其中&nbsp; &ldquo;post_id &rdquo; 复制，然后粘贴替换掉所有的&nbsp; &ldquo;postname&rdquo;</p>\n<p>&nbsp;</p>\n<p><a href=\"https://www.hotwp.net/archives/lb-wordpress-news/www.hotwp.net\" target=\"_blank\" rel=\"noopener noreferrer\"><img class=\"alignnone size-medium wp-image-1415\" title=\"WordPress主题网站&mdash;&mdash;将后台新闻发布链接由汉字类型转变为普通链接方法插图(2)\" src=\"https://www.hotwp.net/wp-content/uploads/2020/03/15853643221-480x338.png\" sizes=\"(max-width: 480px) 100vw, 480px\" srcset=\"https://www.hotwp.net/wp-content/uploads/2020/03/15853643221-480x338.png 480w, https://www.hotwp.net/wp-content/uploads/2020/03/15853643221-768x541.png 768w, https://www.hotwp.net/wp-content/uploads/2020/03/15853643221.png 1304w\" alt=\"WordPress主题网站&mdash;&mdash;将后台新闻发布链接由汉字类型转变为普通链接方法插图(2)\" width=\"480\" height=\"338\" /></a></p>\n<p>&nbsp;</p>\n<p>第三步：替换掉所有的&ldquo;postname&rdquo;之后，点击保存再关闭设置即可。一定要点击保存，否则等于没有更改设置。</p>\n</blockquote>\n<p>&nbsp;</p>\n<p>经过以上步骤讲解，是不设置起来非常的简单和方便呢？如果你是一位&ldquo;强迫症患者&rdquo;，不妨照着流程来实际操作一遍吧！</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><br /><strong>河南浪博电子科技开发有限公司，专注<a href=\"https://www.hotwp.net/archives/lb-wordpress-news/www.hotwp.net\" target=\"_blank\" rel=\"noopener noreferrer\">河南企业网站建设</a>，拥有多年的建站经验；另有多套成品网站供您挑选，是您软件开发合作的最佳选择！浪博全员竭诚欢迎您的到来，期待与您的长期</strong><br /><strong>合作！</strong></p>', '2', '佚名', '1', '/newsDetail?id=', '2020-10-15 15:17:27', '2020-10-30 09:17:17', '0'), ('45', '浪博科技：论URL链接对站点优化的重要性', '', '1036026', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/ejghr63n7via4eecudpu.jpg', null, '<p>前言：论URL链接对站点优化的重要性?我们常常将其必做是网站的命脉，稍有不畅，就会带来各种各样的问题，轻则排名无法提升，重则页面收录都是一个未知数。今天浪博科技分享一篇这个话题的文章，你的网站是否存在这样的缺点呢?</p>\n<p><strong>一：选择URL链接类型</strong></p>\n<p>URL链接如何做?目前有三种类型的展现形式分别是：动态URL、伪静态URL、纯静态URL链接，现在的主流CMS例如帝国、PHPCMS、DEDE等，都支持者三种显示形式。那么如何选择连接形式呢?</p>\n<p>A，动态首先是被否决的，虽然说精简的动态链接，蜘蛛爬行同样没有压力，但是终究我们并不提倡，这是网站发展最初期时候的URL链接形式。</p>\n<p>B,伪静态链接：从URL结构上来看，和纯静态的区别不大，前端可以做任意形式的自定义，但是却不会占用服务器更多的空间。目前典型的代表是：discuz类型的论坛，基本上都采用的伪静态链接。</p>\n<p>C，纯静态链接：链接都是在服务器中直接生成的，优势：直接减少服务器CPU&ldquo;压力&rdquo;和数据库的压力，如果数据量大的话，访问量高峰，应对起来会更为流畅。劣势是：如果对程序模板做更改，那么就要重新对所有页面做生成，而伪静态却要简单的多，同时会占用越来越多的服务器WEB空间。</p>\n<p>那么网站如何选择合适的URL链接展现形式呢?如果：大型网站更适合使用纯静态链接，因为数据量太过庞大，对网站的各方面负载要求都比较大，中小型网站(10W数据量以内的网站)最佳则使用伪静态链接。</p>\n<p><a href=\"https://www.hotwp.net/archives/lb-wordpress-news/www.hotwp.net\" target=\"_blank\" rel=\"noopener noreferrer\"><img title=\"浪博科技：论URL链接对站点优化的重要性插图\" src=\"https://ss0.bdstatic.com/70cFvHSh_Q1YnxGkpoWK1HF6hhy/it/u=749911913,2075988907&amp;fm=26&amp;gp=0.jpg\" alt=\"浪博科技：论URL链接对站点优化的重要性插图\" /></a></p>\n<p><strong>二：URL链接的显示形式</strong></p>\n<p>确定使用哪一种URL链了，那么怎么让其更利于优化呢?首先我们要说的是：不建议使用程序默认的URL连接形式，例如程序默认的是如：http://www.xxxxxxx.com/post/1.html 此类型的，你要知道一点：这套程序已经N多人使用了，都是相同的URL链接形式，首先就输在了起跑线上!所以一般来讲，选择CMS，URL链接形式上，我们是建议&ldquo;自定义&rdquo;的，这样会让网站的起点也更为出众。</p>\n<p>上面说的是URL的自定义，之后再来看一下内部的URL连接怎么显示：</p>\n<p>A，频道URL链接：顶级频道使用一级目录的形式，二级频道使用二级目录的形式，不建议顶级频道、二级频道都使用顶级目录的形式做优化，这样会造成网站无主次，严重分流站点权重。</p>\n<p>B，内容URL链接：内容URL链接通常是要建立在所述频道之上的，例如：https://www.abc.com/ka/de/1.html 有些网站就错误的做成了例如：https://www.abc.com/1.html 这样的类型，这种情况的网站往往收录的哪怕极多，排名也都一般般。</p>\n<p>C，URL链接中文转码，不少网站的URL都有TAG标签，而且是使用的伪静态来生成的，在这里要说的是：百度虽然可以支持中文转码，但是如果程序支持自定义的情况下，尽量不要为蜘蛛增加这一个步骤，最好是使用数字，或者字母的形式来实现TAG的连接，可以参考下新浪、网易的TAG标签的URL做的都非常的棒!</p>\n<p>D，URL连接长度：URL连接无论是长度还是目录深度都是有极限的，URL目录深度不建议超过3层，极限为4层。URL连接的长度整体不建议超过70字符最佳!(可能有人否定我这一个观点)</p>\n<p><a href=\"https://www.hotwp.net/archives/lb-wordpress-news/www.hotwp.net\" target=\"_blank\" rel=\"noopener noreferrer\"><img title=\"浪博科技：论URL链接对站点优化的重要性插图(1)\" src=\"https://ss1.bdstatic.com/70cFvXSh_Q1YnxGkpoWK1HF6hhy/it/u=3036553629,3268617272&amp;fm=11&amp;gp=0.jpg\" alt=\"浪博科技：论URL链接对站点优化的重要性插图(1)\" /></a></p>\n<p><strong>三：URL链接的页面布局</strong></p>\n<p>说到这个问题点，很多网站都有一个问题，搜索引擎Site首页总是不在第一位，可是网站也并没有被降权，而且站点规模越大，这个可能性也就越高，那么!这是为什么呢?很大程度上就是因为页面布局存在不当而导致的。</p>\n<p>1、不是所有的链接都适合写到导航上的，大量的链接都部署到导航上，就有可能导致上述问题的出现，顶部导航，是放最重要的一些频道的位置，通常是&ldquo;顶级栏目&rdquo;，甚至一些没有价值的顶级栏目，例如&rdquo;公司简介&rdquo;这样的也没有必要放上去。当然了也可以根据首页或者栏目页内容页的不同，来做出一些不同形式的导航展现，比如：首页可以显示一级、二级的所有导航，而内页则仅显示当前栏目所属的二级导航，和网站的一级导航条。</p>\n<p>2、有些企业乐此不疲的在网站内部做描文本，恨不得在所有的内容页中都对首页进行描文本，但是却不知道：相同链接出现频率太高，反而会被降低权重评估，包括内页的描文本也是如此。</p>\n<p>3、一些链接没有传递价值，就不要让他去分散页面中的权重(基本上不会产生排名概率的页面)，页面中所有的URL的有效比例越高，那么这个页面才越有价值!</p>\n<p>4、URL链接的整体性，就像是鸟巢一样，如果每一根枝干都是独立存在的，那么还会有鸟巢一说吗。网站的每一条URL都是这样的枝干，只有将其整体搭配起来，才可以让鸟儿栖息。</p>\n<p><strong>注：上述修改只适合未上线，或者URL链接很少的站点；如果站点信息量很多，且已经被搜索引擎收录，不要轻易对站点URL做更改，否则极容易导致站点被降权。有时候最佳未必就是最可行的，适合自己才是最好的，除非你已经无计可施。</strong></p>', '6', '佚名', '1', null, '2020-10-15 15:27:51', '2020-10-30 10:09:23', '0');
COMMIT;

