INSERT INTO `eye_brand_web` VALUES ('1046006', '1', 'https://img.chinapp.com/uploadfile/Pinpai/2015-06-15/14343389487302.jpg', '3M', '3M中国有限公司', '\r\n3M中国有限公司，创立于1902年美国，世界500强，国际公认的研发领域的企业先驱，素以产品丰富和锐意创新著称于世，全球性的多元化科技企业。', 'Wei Chen Moline', '美国', '牙线棒，安全帽', ' 021*****535', 'https://img.chinapp.com/uploadfile/pinpai/original/20180912/75c119456c96b8182e9b56fa5dab0966.jpg', '<p>3M，全球性的多元化科技企业。3M为国际公认的研发领域的企业先驱。我们生产数以万计的创新产品，在医疗产品、高速公路安全、办公文教产品、光学产品等核心市场占据领导地位。<br/></p><p>3M公司创立于1902年，是一家美国企业全称明尼苏达矿务及制造业公司，因英文名称头三个单词以M开头，所以简称为3M公司。</p><p>时至今日，3M公司已经成为世界著名的多元化跨国企业，在全球拥有近6万多种产品。涉及领域包括通信、交通、工业、汽车、航天、航空、电子、电气、医疗、建筑、文教办公及日用消费等诸多领域。目前，全球每天有50%的人直接或间接地接触到3M的产品，在城市中这个比率更是超过95%。创新不断驱动企业的发展。3M公司是道琼斯工业平均指数(DowJonesIndustriaAverage)包括的30家公司之一(1976年8月9日加入)，并且在2004年财富500强中位列第105位。满载全球的信赖和非凡的荣誉，3M创新的脚步更加坚定。</p><p>3M在世界品牌实验室(WorldBrandLab)编制的2006年度《世界品牌500强》排行榜中名列第一百六十一，在《巴伦周刊》公布的2006年度全球100家大公司受尊重度排行榜中名列第十五。该企业在2007年度《财富》全球最大五百家公司排名中，以2007年营业收入22923百万美元，名列第三百零一。</p><p>在通信行业的电缆接续系列和光纤接续系列产品中，3M公司所用的技术和产品始终处于世界领先水平。3M公司采用的先进通信专利技术，生产和销售各种电话网络的连接、保护和测试产品。3M公司设计的U型接续原理，连接电缆芯线，在通信电缆芯线接续领域中开创了新的一页，取代了以往传统的扭接、焊锡方式，大大提高了接续质量及生产效率，降低了故障率和维护经费，受到了全国各电信部门的欢迎。在电缆的保护上，3M公司为用户提供了一套全面的解决方案。针对不同类型的电缆，如充油电缆可提供BB型充油电缆、护套及工具，充气电缆有2T电缆护套，还有SLiC架空电缆接头外护套，又称之为&quot;通风式&quot;的架空外护套。提供的产品齐全且倍受肯定。</p><p>3M在中国</p><p>1984年11月,3M中国有限公司在上海注册成立，是在经济特区外成立的中国第一家外商独资企业，在中国投资超过85亿人民币。</p><p>目前，3M公司在中国已建立了12家公司、11个生产基地、27个办事处、1个研发中心和4个技术中心，员工超过8,200人。</p><p>创新的文化</p><p>3M公司以其为员工提供创新的环境而著称，视革新为其成长的方式，视新产品为生命。公司的目标是：每年销售量的30%从前4年研制的产品中取得。每年，3M公司都要开发200多种新产品。它那传奇般的注重创新的精神已使3M公司连续多年成为美国最受人羡慕的企业之一。在过去15年中，著名的《财富》杂志每年都出版一份美国企业排行榜，其中有10年3M公司均名列前10名。面对[[知识经济]的挑战，3M公司的知识创新实践，为企业提供了不可多得的范例。</p><p>新产品不是自然诞生的。3M公司的知识创新秘诀之一就是努力创造一个有助于创新的内部环境，它不但包括硬性的研发投入，如公司通常要投资约7%的年销售额用于产品研究和开发，这相当于一般公司的二倍，更重要的是建立有利于创新的企业文化。</p><p>公司文化突出表现为鼓励创新的企业精神。3M公司的核心的价值观：坚持不懈，从失败中学习，好奇心，耐心，事必躬亲的管理风格，个人主观能动性，合作小组，发挥好主意的威力。新产品不是自然诞生的。3M公司的知识创新秘诀之一就是努力创造一个有助于创新的内部环境，它不但包括硬性的研发投入，如公司通常要投资约7%的年销售额用于产品研究和开发，这相当于一般公司的二倍，更重要的是建立有利于创新的企业文化。尊重个人的尊严和价值，鼓励员工各施所长，提供一个公平的、有挑战性的、没有偏见的、大家分工协作式的工作环境。尊重个人权利，经常与员工进行坦率的交流。主管和经理要对手下员工的表现与发展负责。鼓励员工发挥主观能动性，为其提供创新方面的指导与自由。冒险与创新是公司发展的必然要求，要在诚实与相互尊重的气氛中给予鼓励和支持。</p><p>3M的成功是基于对多个卓越科技平台的开发和交互使用来满足现实社会中广泛市场领域的客户需求。3M承诺为全世界的人们提供更加方便、更加美好的生活方式。</p><p><strong>我们的价值观：</strong></p><p>严格遵循正直、诚实的商业操守以卓越的品质、价值和服务满足客户的需求持续发展，为股东提供可观的回报尊重社会和自然环境尊重员工价值、发挥其潜力、鼓励创始力和领导力成为备受尊崇的企业楷模、</p>	', '1984-11-09', '309', '2020-08-03 11:18:34', '2020-10-10 14:25:26', '0'), ('1046007', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562061158.gif', '绿盾口罩', '上海兴诺康纶纤维科技股份有限公司', '上海兴诺康纶纤维科技股份有限公司，绿盾，口罩十大品牌，行业标准起草单位，知名健康纺织品专家，中国抗菌协会副理事长单位，集研发、设计、销售为一体的企业', '', '上海市', '', '400-109-1990,400-109-1910', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562060687.png', '<p>呼吸防护产品和健康纺织品专家，集研发/设计/品牌/销售为一体，提供康纶纤维抗菌和绿盾健康呼吸系列产品</p><br>\r\n<p>\r\n上海兴诺康纶纤维科技股份有限公司（股票代码：835159）是呼吸防护产品和健康纺织品专家。公司集研发、设计、品牌、销售为一体，从纤维科技的角度，切入健康产业，为社会提供康纶纤维抗菌和绿盾健康呼吸两大系列高科技产品。\r\n</p>\r\n<p>\r\n<span>众所周知，环境破坏造成了大气污染和细菌肆虐的恶果，全世界每年死于呼吸道疾病和细菌感染的人数超过2000万（出处：百度百科——超级病菌词条）。兴诺公司的康纶抗菌纤维产品（贴身服饰和医用纺织品）和绿盾PM2.5呼吸防护产品（布料及无纺口罩）有效截断细菌病毒和空气污染物通过皮肤侵入和呼吸吸入损害人类健康的这两个主要途径，是保护人类健康的卫士。</span>\r\n</p>\r\n<p>\r\n公司研发的CLEANCOOL康纶纤维是通过NDM-1，MRSA，H1N1三大细菌抗菌测试的抗菌产品，抗菌性能强，同时也是通过Oeko-tex100纺织品安全认证的抗菌吸排纤维。康纶纤维被英国国防部列为军用内衣指定原料，并通过日本SEK抗菌红色认证。目前也已通过H7N9抗菌测试。\r\n</p>\r\n<p>\r\n2011年，公司研发出兼具超微抗菌和超微过滤的微滤滤材，并以此为基础生产绿盾PM2.5口罩系列产品。由该滤材制成的滤片经美国NELSON实验室测试（ASTMF2299标准，），对直径为0.1微米（PM0.1）的空气颗粒物的过滤效率显著，同时符合抗菌国家标准的要求。2012年，使用微滤技术的绿盾PM2.5系列口罩大批上市，为广大市民抵御空气污染，保护呼吸健康提供了优良的产品，并一举成为国产防雾霾口罩的创始品牌。\r\n</p>\r\n<p>\r\n公司通过ISO9001质量管理体系认证和ISO14001环境管理体系认证。\r\n</p>', '2000', '3', '2020-08-03 11:24:47', '2020-08-05 10:22:32', '0'), ('1046008', '1', 'https://img.chinapp.com/uploadfile/pinpai/original/20200624/14fe114a10225c5c78f3ded5d6821872.png', '\r\nHoneywell霍尼韦尔', '霍尼韦尔(中国)有限公司', '霍尼韦尔（中国）有限公司，始于1885美国，世界500强，航空航天/自动化控制系统/交通系统/特殊材料等领域专业的行业解决方案供应商，多元化的高科技大型跨国集团。', 'BIN SHEN（沈斌）', '美国', '开关面板，拉压力传感器，安全帽', ' 400-840-2233', 'https://img.chinapp.com/uploadfile/pinpai/original/20181107/c6ff075dc49cb26169936b6d57933ff6.jpg', '<p>霍尼韦尔（Honeywell）为全球客户提供专业的行业解决方案，涵盖航空和汽车产品及服务，楼宇、住宅和工业控制技术，以及特性材料。从飞机、汽车、住宅、楼宇、制造工厂、供应链到工人，我们的技术致力于万物互联，创造一个更智能、更安全和更可持续发展的世界。</p><p><strong>霍尼韦尔在中国</strong></p><p>霍尼韦尔在中国霍尼韦尔在华的历史可以追溯到1935年。当时，霍尼韦尔在上海开设了第一个经销机构。1972年美国总统尼克松访华时，应中国政府之邀从十大领域推荐精英企业来华推动两国双向交流，并促进中国的现代化建设。其中炼油石化领域唯一被选中推荐给中国政府的美国环球油品公司，正是霍尼韦尔旗下的子公司。80年代的改革开放成为了霍尼韦尔融入中国经济发展的又一个新起点，作为首批在北京设立代表处的跨国企业，霍尼韦尔在彼时开始了一系列的高品质投资。目前，霍尼韦尔四大业务集团均已落户中国，旗下所辖的所有业务部门的亚太总部也都已迁至中国， 并在中国的20多个城市设有多家分公司和合资企业。目前，霍尼韦尔在中国的投资总额超10亿美金，员工人数超过12,000名。</p><p>霍尼韦尔持续发展的动力源自同步实现了两个似乎无法兼顾的目标–生产效率和增长。 我们的全球流程 – 或方法– 是霍尼韦尔核心的内部业务流程，也是我们不断提高效率和服务质量的驱动力。霍尼韦尔方法使我们能够以更快的速度和更低的成本为客户提供世界级的产品和服务。</p><p>业务部门</p><p><strong>航空航天集团</strong></p><p>全球几乎所有商用、防务和航天飞机上均有霍尼韦尔航空航天集团各类产品和服务的身影。霍尼韦尔的涡轮增压器也被全球几乎所有汽车和卡车制造商所采用。航天航天集团旗下业务单元研发创新解决方案，以及飞机发动机、驾驶舱和客舱电子设备、空中无线网络连接、物流等技术和产品，以降低汽车和飞机油耗，提高航班准点率，提升飞行和跑道安全。在中国，霍尼韦尔的航空业务由四家业内领先的合资企业及一家独资企业组成，为中国国内及国际航空市场提供辅助动力装置、航空零备件、航空电子产品及机轮与刹车产品等维修服务，并生产发动机及环境控制系统相关部件。该集团旗下霍尼韦尔交通系统的涡轮增压器为中国和世界各地的汽车和卡车制造商采用。</p><p><strong>智能建筑与家居集团</strong></p><p>霍尼韦尔智能建筑与家居集团的产品、软件和技术已在全球超过1.5亿个家庭和1,000万栋建筑中使用，助力家庭实现互联，掌控住宅舒适度、安全性以及能源的使用；确保商业楼宇业主和用户的设施安全、节能、具有可持续性与高生产力。智能建筑与家居集团还拥有先进的计量硬件及软件解决方案，帮助电力、燃气及水供应方为消费者与社区提供更高效的服务。在中国，该集团围绕水处理和空气净化推出了一系列创新的智能家居产品，满足中国消费者日益增长的个人健康需求，带来更安全、舒适和健康的体验。</p><p><strong>安全与生产力解决方案集团</strong></p><p>霍尼韦尔安全与生产力解决方案集团为全球超过5亿作业人员提供移动工业电脑、语音软件和工作流、条码扫描仪、打印解决方案、气体检测技术和个人防护设备，帮助提高作业的安全性和事故应对能力，优化作业流程，提升企业绩效。在中国，其一系列创新技术和互联解决方案广泛应用于工业、能源、建筑、交通、医疗、零售等领域，帮助作业者提升能效、安全性与生产力，同时降低资源消耗和环境污染。</p><p><strong>特性材料和技术集团</strong></p><p>霍尼韦尔特性材料和技术集团是全球领先的特性材料、工艺技术和自动化方案供应商。该集团旗下特性材料业务专业生产广泛多样的高性能产品，在中国其主要产品包括用于空调和制冷的环保型制冷剂、节能隔热发泡剂、食品与药品包装的特殊薄膜、多用途的高级纤维、用于分析和化学实验室研究的溶剂和无机物、用于半导体和显示器行业的电子材料以及研究化学品等。该集团旗下的霍尼韦尔UOP提供炼油、石油化工、气体处理技术和软件服务，是全球石油天然气行业的基石。该集团旗下还包括霍尼韦尔过程控制部，是提供以软件为基础的自动化控制系统、仪器仪表和相关服务的行业先锋。</p>', '1885', '4', '2020-08-03 11:29:25', '2020-08-05 13:58:22', '0'), ('1046009', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562066747.gif', 'UVEX', '优唯斯(广州)安全防护用品有限公司', '优唯斯（广州）安全防护用品有限公司，防护用品十大品牌，始创于1926年德国，个人安全防护用品领域的知名供应商，为人类在工作、运动和休闲活动时提供最佳保护', '彭晓明', '德国', '防护眼镜', ' 02034792338', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562073243.png', '<p>始创于1926年德国，防护用品十大品牌，工业安全防护用品领域的知名供应商，为人类在工作、运动和休闲活动时提供最佳保护</p><p><br/></p><p>优唯斯于1926年由Phillip M. Winter创建，总部设于德国 Furth 市。现任总裁Rainer Winter, 于六十年代初接管优唯斯并成功把公司升格成一所全球企业。优唯斯安全集团去年销售额超越1亿6千5百万欧元，在安全护目镜领域表现尤其突出。&nbsp;</p><p>优唯斯安全集团主要由四个战略发展中心组成: 头部防护(安全眼镜/ 矫视安全眼镜/ 激光防护安全眼镜/ 安全头盔/ 听力保护/ 呼吸防护) 、躯体防护、 足部防护和手部防护。通过与顾客紧密的联系，既可以根据顾客的需求提供产品，及积极建议相应的解决方案；同时兼收并蓄运动产品上的科研技术， 为职业安全产品的增值提供动力，籍此满足客户对健康与安全永无止境的追求。&nbsp;</p><p>优唯斯所有产品先通过体育运动员进行测试, 广大客户就能享受较大效益。为了提升产品品牌, 优唯斯与世界职业运动员紧密联系，为他们提供度身定制的运动保护装备。这种无间的合作伙伴关系促使所有优唯斯产品不断推陈出新，并保障所有的零部件无论从质量、选料和安全系数上均符合不同国家法规和国际公认标准。</p><p>优唯斯（广州）安全防护用品有限公司为德国优唯斯安全防护用品有限公司在中国设立的子公司。</p><p>优唯斯成立于1926年，总部设于德国Furth市。优唯斯品牌作为高品质创新产品的象征，通过不断的产品研发及技术创新，并结合其制造优势，为各行各业提供安全防护。优唯斯品牌的的眼部防护产品延伸至听力防护、头部防护、呼吸防护、手部防护、躯体防护及足部防护产品。</p>', '2005-06-24', '0', '2020-08-03 11:32:36', '2020-08-04 09:46:17', '0'), ('1046010', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562059618.gif', 'Kowa三次元', '兴和通商股份有限公司', '兴和通商股份有限公司，兴和-三次元，始于1894年日本，注重节能，大力推广环保产品，在纤维和医药制品方面不断突破，立志将商品企划到生产及销售的过程实施纵向一体化的企业', '', '日本', '', ' +02-2523-2860,0800-600-566', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562059124.png', '<p>兴和通商股份有限公司，Kowa三次元，始于1894年日本，兴和株式会社旗下，专注于健康、医疗、化学多个领域，集口罩生产、制造、销售贸易为一体的企业</p><br>\r\n<p>\r\n兴和自创业至今已有120年的历史，其间兴和集团始终把握时代潮流，审视环境变化，建立了现在的事业，这正是集团得以不断成长与发展的力量源泉，今天兴和集团在更多领域开展企业活动，继续提高您的生活文化内容而作出努力。\r\n</p>\r\n<p>\r\n兴和集团不仅维系了创业以来的纤维业务，如今从销售不断扩大的医药制品「LIVALO(力清之)」为代表，从精细化学制品领域到对资源的开发利用以及对发展中国家城市基础设施的国际型投资面向世界五大洲呈现出全球化优势，在各个业务领域，关注人们的生活样式的变化，以人人享受健康生活为主题推动产品开发，追求节能的技术，大力推广环保产品的生产。兴和集团的社会使命旨在把从商品企划到生产及销售的过程实施纵向一体化的战略性整合，对全球商务领域实施横向扩展中，以追求和实现舒适、富裕的生活为目标。\r\n</p>\r\n<p>\r\n与此同时，我们也将目光投向未来100年、200年甚至以后，不断推进变革与发展，并有意将现有的事业传承给下一代。我们的目标是通过这些事业为社会贡献力量，建构一个茁壮发展且富裕的社会。\r\n</p>', '1894', '24', '2020-08-03 11:36:01', '2020-10-10 08:52:40', '0'), ('1046011', '1', 'https://img.chinapp.com/uploadfile/pinpai/original/20190717/63f83243582ab30d2643a3b3a3bc9002.jpg', '稳健Winner', '稳健医疗用品股份有限公司', '稳健医疗用品股份有限公司，广东省著名商标，中国医用敷料产品主要出口商，旗下有多家全资子公司，专注于医用卫生材料和医用敷料的大型医疗用品，集研发、生产、国际贸易销售、直营连锁销售为一体的高科技公司', '李董', '广东省深圳市', '稳健创可贴,稳健口罩,稳健医药', ' 0755-28138888', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562066993.png', '<p>致力于提供感染防护/伤口护理和家庭护理整体解决方案，专业研发生产和销售以棉花为主要原材料的医用敷料和日用消费品的企业</p><p><br/></p><p>稳健医疗用品股份有限公司（简称稳健医疗）：于2000年设立稳健实业（深圳）有限公司，为进一步适应公司未来发展战略，于2015年正式改制为稳健医疗用品股份有限公司。拥有11家控股子公司，1家参股公司，员工总数超过6000人，拥有二十余年医用卫生材料和医用敷料生产经验，主要产品系列有：医用伤口敷料、手术室耗材、医用卫生材料及家庭卫生护理用品等，是一家研发、生产和销售以棉花为主要原材料的医用敷料和日用消费品的自主创新企业。&nbsp; &nbsp;&nbsp;</p><p>稳健医疗拥有两大品牌：Winner稳健和PurCotton全棉时代。Winner稳健作为医疗品牌，为医疗单位提供全球先进的伤口护理和感染防护解决方案，并拓展至家庭护理领域，是中国医用敷料产品主要出口商，每年向全球各地提供大量一次性医疗用品；截至目前，稳健产品已进入八百多家医院和两万余家药店，是中国医用敷料行业标杆企业。PurCotton全棉时代作为日用品牌，传承20余年医学制造经验，以100%全棉为原料，凭借自主研发的全棉水刺无纺布专利技术，打造出健康、舒适、环保的系列化高端全棉生活用品；在深圳、北京、上海、广州等全国20多个重点城市的大型购物中心开设104家直营连锁店，成功迈出了“医学贴近生活 全棉呵护健康”的医转民的战略步伐。</p>', '1991', '0', '2020-08-03 11:39:28', '2020-08-04 09:48:52', '0'), ('1046012', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562052733.gif', '阳普IMPROVE', '广州阳普医疗科技股份有限公司', '广州阳普医疗科技股份有限公司，专注于真空采血系统开发，全球血清类采血管血清制备供应商，其防霾口罩因具有微粒阻隔系统而闻名', '邓冠华', '广东省广州市', '', ' 02032312666', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562053155.png', '<p>成立于1996年，全球血清类采血管血清制备供应商，其防霾口罩因具有微粒阻隔系统而闻名</p><p>广州阳普医疗科技股份有限公司（以下简称“阳普医疗”）成立于1996年，2009年在深圳创业板上市，股票代码300030。<br/></p><p>自成立以来，阳普医疗通过持续的技术创新与管理创新，不断向医疗器械产品平台和医疗服务相结合的集团化、国际化公司迈进。截至目前，公司业务领域已涵盖“临床实验室标本解决方案”、“临床实验室诊断”、“影像学诊断”、“临床护理与麻醉”、“健康管理”和“医院数字化整体解决方案”等平台。公司在中国大陆、中国香港、美国与德国等地拥有近20家子公司及分支机构，产品和服务已覆盖全球九十多个国家和地区的近万家医疗机构。</p>', '1996-08-19', '4', '2020-08-03 11:42:44', '2020-08-05 13:54:50', '0'), ('1046013', '1', 'https://img.chinapp.com/uploadfile/Pinpai/2017-04-24/14930328029011.gif', 'HAKUGEN白元', '白元日用品制造(深圳)有限公司', '日本白元株式会社，白元家庭用品（深圳）有限公司，取暖贴十大品牌，始于1923年，国内取暖贴行业极具竞争力和发展潜力品牌，在日本被誉为“高科技日化产品制造专家”。', '渡部正彦', '深圳', '医用棉签', ' 13612907894', 'https://img.chinapp.com/uploadfile/pinpai/original/20180913/f32afbc4ed1cc2a555bbf5259746b3bf.jpg', '<p>白元家庭用品（深圳）有限公司隶属于日本白元株式会社，是该集团在华设立的全资子公司。</p><p>日本白元株式会社创始于1923年，到目前为止已经有了91年的历史，公司前身是专业进行防虫防臭剂的“镰田商会”，创业之后由于公司的明星产品衣物用荧光染料在市场中非常畅销，所以公司名称也变更为明星产品的品牌“白元”，并一直沿用至今。截至目前为止，本公司已经发展成为能够生产和销售包括家庭用防蛀剂、除湿剂、即热贴、沐浴乳，口罩，化妆用品等在内的各类日化产品的综合性企业。白元工厂通过了国际标准ISO9001认证，在保证产品质量的同时，不断追求更高的质量标准。</p><p>白元株式会社为回馈社会，长久以来与“联合国儿童基金会”等组织协作，开展各类感恩社会的活动。其中包括巴基斯坦地震灾害后学校的重建活动，以及受龙卷风灾害的缅甸学校的重建活动等各类社会公益活动，使本集团及本品牌在全球市场中树立起了良好的形象。今后公司也将竭力参与和支持在中国的各类慈善活动，为中国消费者及日化产品市场作出更大的贡献。</p><p>白元家庭用品（深圳）有限公司成立于2004年12月1日，是一家以白元品牌日用百货系列产品销售为中心的公司。公司秉承着日本白元株式会社一贯的“追求更高品质生活”的宗旨，向中国的消费者提供包括防虫剂、除湿剂、除甲醛等在内的各类与衣、住、行方面密切相关的日用品，给消费者带来更安心体验。公司自成立以来，白元产品已经先后进入到国内包括广州、上海、北京、青岛、大连等众多城市市场，并受到当地消费者的一致好评。</p><p>白元家庭用品（深圳）有限公司以季节性销售为主轴，充分考虑中国南北方气候及生活习惯差异，不断推出适用于各季节的各类明星品牌日用产品。今后，公司还会将重点销售区域由东部沿海城市，逐步扩展到国内其他内陆地区。白元家庭用品（深圳）有限公司将一如既往地为中国消费者提供放心、满意的产品，希望赢得更多消费者的关注与支持。</p>', '2012-08-08', '13', '2020-08-03 11:53:52', '2020-08-05 16:32:50', '0'), ('1046014', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-07/1562494303.gif', 'Dettol滴露', '利洁时家化(中国)有限公司', '利洁时家化（中国）有限公司，Dettol滴露，1932年诞生于英国，全球领先及信赖的消毒及个人卫生品牌，全球闻名的家用清洁用品公司。', '赛董', '英国', '消毒液', ' 010-57692888', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-07/1562496219.png', '<p>诞生于1932年英国，利洁时旗下，全球领先及信赖的消毒及个人卫生品牌，全球闻名的家用清洁用品公司</p><p>1932年，英国细菌学家雷诺博士研制成功滴露消毒液，最早被用于英国的妇产医院。它的主要特点：“滴露对消毒科学较大的贡献是有效去除细菌，却又对人体组织无害。</p><p>滴露是全球信赖的消毒及个人卫生品牌，源于医院，有近80年的专业消毒经验。滴露消毒液安全有效杀菌，保护家人健康。滴露产品还包括衣物除菌液、沐浴液、香皂及洗手液。</p><p>有效、安全、值得信赖的健康保护，就是滴露品牌努力的目标。从核心产品滴露消毒液，衍生出了全系列的健康保护产品，包括：滴露衣物除菌液、滴露香皂、滴露洗手液、滴露免洗抑菌洗手液、滴露沐浴液。</p><p>远离致病菌，您和您的家人才能保持健康。才有力量生活得更精彩。80年来，无论是专业卫生经验的积累，不断改进的产品，还是公共卫生教育，滴露所有努力只有一个目的，帮助您保持健康。</p><p>滴露于1993年正式开始在中国销售。秉承全球70余年的专业消毒经验，滴露一直致力于在家居和个人护理方面为消费者提供既高效又安全的消毒方案，以保护消费者及其家人的健康。这些消毒产品包括滴露消毒液、滴露衣物除菌液、滴露健康沐浴露、滴露健康抑菌香皂和滴露抑菌洗手液。目前，滴露已销往全国50多个城市，并成为消费者心目中值得信赖的消毒品牌。在正式登陆中国后，滴露也一直积极参加社会公益活动，回馈社会。在重大灾害以及流行疾病暴发期间，滴露在积极捐赠消毒物资的同时还大力推广健康卫生教育工作，为倡导良好卫生习惯以及促进中国人民健康的事业贡献了一份绵薄之力！</p>', '1932', '2', '2020-08-03 11:56:38', '2020-08-05 10:30:09', '0'), ('1046015', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562065003.gif', '朝美CM', '建德市朝美日化有限公司', '建德市朝美日化有限公司，杭州市著名商标，CCTV推荐的防H1N1流感的口罩品牌，拥有专门的研发组及检测室，并在国内首家应用环氧乙烷灭菌消毒设备，国内较具规模的专业防尘口罩生产企业', '', '北京市', '', ' 400-6661967,0571-64199168', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562066313.png', '<p>建德市朝美日化有限公司，杭州市著名商标，职业防尘PPE专业口罩品牌，专业从事自主研发、检测、制造多种职业防尘/防毒口罩的现代化企业</p><br>\r\n<p>\r\n<br>\r\n</p>\r\n<p>\r\n建德市朝美日化有限公司，位于浙江西部，地处杭州西郊，附有一级水资源的千岛湖新安江畔。公司地域面积22000平方米，生产工区10000余平方米，原材料仓库6000余平方米，综合办公楼6000平方米，绿化面积占总公司总面积45%。是一个以高科技为起点，具有职业防尘中国PPE专业生产口罩的企业。也是业内公认的优秀企业之一。\r\n</p>\r\n<p>\r\n朝美在“非典”时期为国家承担重任。根据国家发改委批示，由朝美为北京小汤山医院；地坛医院；北京传染病医院；中国人民解放军总后勤部；三零二 .三零九中日友好医院及国家应急物资储备中心供应防“非典”口罩。公司拥有专门的研发组及检测室，并在国内应用环氧乙烷灭菌消毒设备。公司依靠雄厚的技术实力和成熟的管理模式，研发并生产了多种职业防尘/防毒口罩。\r\n</p>\r\n<p>\r\n“CM朝美”口罩通过国内验证：2000年被国家经贸委安全科学技术研究中心指定生产防N-亚硝基化合物新型口罩。并取得了特种劳动防护用品安全标志证书（LA认证）；全国工业产品生产许可证；医疗器械生产企业许可证；公司已通过ISO9001:2008国际质量体系认证，欧洲CE EN149:2001工业防尘和欧洲CEEN14683:2005医用标准。\r\n</p>\r\n<p>\r\n“CM朝美”的职业防尘口罩在研发和生产过程中始终以科技创新及对用户的安全与健康放在首位。公司与一部分院校及安全科学技术研究中心共同研发的防N-亚硝基化合物新型过滤材料，为劳动防护行业及广大劳动人民作出了巨大贡献。\r\n</p>', '2000', '10', '2020-08-03 11:59:22', '2020-08-06 09:25:40', '0'), ('1046016', '1', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562066747.gif', '1212', '优唯斯(广州)安全防护用品有限公司', '百年来以创新闻名的世界500强企业3M，拥有强大的液体过滤核心技术平台和超过90年的液体过滤行验，是世界上唯一业务横跨工业、医疗、食品饮料和', '彭晓明', '德国', '防护眼镜', '02034792338', 'https://img.chinapp.com/uploadfile/spider_img/2019-07-02/1562073243.png', '<p>始创于1926年德国，防护用品十大品牌，工业安全防护用品领域的知名供应商，为人类在工作、运动和休闲活动时提供最佳保护</p><p><br/></p><p>优唯斯于1926年由Phillip M. Winter创建，总部设于德国 Furth 市。现任总裁Rainer Winter, 于六十年代初接管优唯斯并成功把公司升格成一所全球企业。优唯斯安全集团去年销售额超越1亿6千5百万欧元，在安全护目镜领域表现尤其突出。&nbsp;</p><p>优唯斯安全集团主要由四个战略发展中心组成: 头部防护(安全眼镜/ 矫视安全眼镜/ 激光防护安全眼镜/ 安全头盔/ 听力保护/ 呼吸防护) 、躯体防护、 足部防护和手部防护。通过与顾客紧密的联系，既可以根据顾客的需求提供产品，及积极建议相应的解决方案；同时兼收并蓄运动产品上的科研技术， 为职业安全产品的增值提供动力，籍此满足客户对健康与安全永无止境的追求。&nbsp;</p><p>优唯斯所有产品先通过体育运动员进行测试, 广大客户就能享受较大效益。为了提升产品品牌, 优唯斯与世界职业运动员紧密联系，为他们提供度身定制的运动保护装备。这种无间的合作伙伴关系促使所有优唯斯产品不断推陈出新，并保障所有的零部件无论从质量、选料和安全系数上均符合不同国家法规和国际公认标准。</p><p>优唯斯（广州）安全防护用品有限公司为德国优唯斯安全防护用品有限公司在中国设立的子公司。</p><p>优唯斯成立于1926年，总部设于德国Furth市。优唯斯品牌作为高品质创新产品的象征，通过不断的产品研发及技术创新，并结合其制造优势，为各行各业提供安全防护。优唯斯品牌的的眼部防护产品延伸至听力防护、头部防护、呼吸防护、手部防护、躯体防护及足部防护产品。</p><p><br/></p>', '2005-06-24', '0', '2020-08-06 12:00:36', '2020-08-06 12:00:36', '0');
COMMIT;

