INSERT INTO `eye_brand_web_mer` VALUES ('1', '1046006', '3M净水器', 'https://img.chinapp.com/uploadfile/Articles/day_010101/bac72b2b183cb24bc1ffe53fc8714295.jpg', '3M中国有限公司', '9000', '3000', '6000', '环保/净水器', '百年来以创新闻名的世界500强企业3M，拥有强大的液体过滤核心技术平台和超过90年的液体过滤行验，是世界上唯一业务横跨工业、医疗、食品饮料和...', 'e9iydx4r804562wib9iy.pptx', ' 021*****535', '2020-08-03 13:46:35', '2020-08-03 13:46:35', '0'), ('2', '1046016', '3M净水器', 'https://img.chinapp.com/uploadfile/Articles/day_010101/bac72b2b183cb24bc1ffe53fc8714295.jpg', '优唯斯(广州)安全防护用品有限公司', '300', '3000', '6000', '环保/净水器', '百年来以创新闻名的世界500强企业3M，拥有强大的液体过滤核心技术平台和超过90年的液体过滤行验，是世界上唯一业务横跨工业、医疗、食品饮料和', '', '02034792338', '2020-08-06 12:00:36', '2020-08-06 12:00:36', '0');
COMMIT;

