bsp;</p>\n<p><strong data-spm-anchor-id=\"a220o.1000855.0.i5.3bdb391f9zBe2d\">目录</strong></p>\n<p>&nbsp;</p>\n<p>章 引言 &hellip;&hellip;&hellip;1&nbsp;<br />节 研究对象 &hellip;&hellip;&hellip;1&nbsp;<br />第二节 学科流派演变 &hellip;&hellip;&hellip;5&nbsp;<br />第三节 企业理论 &hellip;&hellip;&hellip;11&nbsp;<br />第二章 市场结构 &hellip;&hellip;&hellip;17&nbsp;<br />节 市场结构的含义与类型 &hellip;&hellip;&hellip;17&nbsp;<br />第二节 市场结构的影响因素 &hellip;&hellip;&hellip;21&nbsp;<br />第三节 市场结构的度量 &hellip;&hellip;&hellip;27&nbsp;<br />第三章 完全垄断 &hellip;&hellip;&hellip;35&nbsp;<br />节 完全垄断的产生原因 &hellip;&hellip;&hellip;35&nbsp;<br />第二节 自然垄断 &hellip;&hellip;&hellip;38&nbsp;<br />第三节 买方垄断 &hellip;&hellip;&hellip;44&nbsp;<br />第四章 寡头垄断 &hellip;&hellip;&hellip;54&nbsp;<br />节 古诺模型 &hellip;&hellip;&hellip;54&nbsp;<br />第二节 伯川德模型 &hellip;&hellip;&hellip;61&nbsp;<br />第三节 卡特尔的均衡分析 &hellip;&hellip;&hellip;68&nbsp;<br />第四节 重复博弈和默契合谋 &hellip;&hellip;&hellip;73&nbsp;<br />第五章 垄断竞争与产品差异 &hellip;&hellip;&hellip;81&nbsp;<br />节 垄断竞争 &hellip;&hellip;&hellip;81&nbsp;<br />第二节 差异产品 &hellip;&hellip;&hellip;84&nbsp;<br />第三节 差异产品与区位模型 &hellip;&hellip;&hellip;87&nbsp;<br />第六章 企业并购 &hellip;&hellip;&hellip;99&nbsp;<br />节 横向并购 &hellip;&hellip;&hellip;99&nbsp;<br />第二节 纵向并购 &hellip;&hellip;&hellip;5&nbsp;<br />第三节 混合并购 &hellip;&hellip;&hellip;112&nbsp;<br />第七章 进入与退出 &hellip;&hellip;&hellip;119&nbsp;<br />节 进入与进入障碍 &hellip;&hellip;&hellip;119&nbsp;<br />第二节 退出与退出障碍 &hellip;&hellip;&hellip;131&nbsp;<br />第三节 进入与退出障碍的测度 &hellip;&hellip;&hellip;134&nbsp;<br />第四节 进退无障碍理论 &hellip;&hellip;&hellip;136&nbsp;<br />第八章 定价行为 &hellip;&hellip;&hellip;142&nbsp;<br />节 驱逐对手定价 &hellip;&hellip;&hellip;142&nbsp;<br />第二节 搭售定价 &hellip;&hellip;&hellip;150&nbsp;<br />第三节 歧视定价 &hellip;&hellip;&hellip;155&nbsp;<br />第四节 拍卖定价 &hellip;&hellip;&hellip;159&nbsp;<br />第九章 纵向限制 &hellip;&hellip;&hellip;165&nbsp;<br />节 纵向限制的含义与类型 &hellip;&hellip;&hellip;165&nbsp;<br />第二节 纵向限制的经济逻辑 &hellip;&hellip;&hellip;166&nbsp;<br />第三节 转售价格维持 &hellip;&hellip;&hellip;175&nbsp;<br />第四节 特许经营 &hellip;&hellip;&hellip;179&nbsp;<br />第十章 广告 &hellip;&hellip;&hellip;186&nbsp;<br />节 信息与广告 &hellip;&hellip;&hellip;186&nbsp;<br />第二节 广告强度及决策 &hellip;&hellip;&hellip;190&nbsp;<br />第三节 广告的福利效应 &hellip;&hellip;&hellip;195&nbsp;<br />第四节 虚假广告与规制 &hellip;&hellip;&hellip;198&nbsp;<br />第十一章 研究与开发 &hellip;&hellip;&hellip;203&nbsp;<br />节 研发、创新与专利 &hellip;&hellip;&hellip;203&nbsp;<br />第二节 市场结构与创新 &hellip;&hellip;&hellip;207&nbsp;<br />第三节 研发中的合作行为 &hellip;&hellip;&hellip;212&nbsp;<br />第四节 研发的公共政策 &hellip;&hellip;&hellip;214&nbsp;<br />第十二章 市场绩效的衡量 &hellip;&hellip;&hellip;222&nbsp;<br />节 市场绩效的界定 &hellip;&hellip;&hellip;222&nbsp;<br />第二节 市场绩效的衡量指标 &hellip;&hellip;&hellip;225&nbsp;<br />第三节 市场绩效的综合评价 &hellip;&hellip;&hellip;229&nbsp;<br />第十三章 反垄断政策 &hellip;&hellip;&hellip;239&nbsp;<br />节 相关市场界定 &hellip;&hellip;&hellip;240&nbsp;<br />第二节 垄断协议 &hellip;&hellip;&hellip;244&nbsp;<br />第三节 滥用市场支配地位 &hellip;&hellip;&hellip;249&nbsp;<br />第四节 经营者集中 &hellip;&hellip;&hellip;254&nbsp;<br />第五节 反垄断政策的实施 &hellip;&hellip;&hellip;260&nbsp;<br />第十四章 规制政策 &hellip;&hellip;&hellip;267&nbsp;<br />节 经济性规制 &hellip;&hellip;&hellip;267&nbsp;<br />第二节 社会性规制 &hellip;&hellip;&hellip;276&nbsp;<br />第三节 激励性规制与放松规制 &hellip;&hellip;&hellip;283&nbsp;<br />中英文对照术语表 &hellip;&hellip;&hellip;292&nbsp;<br />后记 &hellip;&hellip;&hellip;296</p>\n<p><img id=\"desc-module-4\" class=\"desc_anchor img-ks-lazyload\" src=\"https://assets.alicdn.com/kissy/1.0.0/build/imglazyload/spaceball.gif\" /></p>\n<p><strong>内容提要</strong></p>\n<p>本书为一本面向本科生高年级和研究生一年级的产业经济学教科书，由产业经济学领域全国的教育部人文社科重点研究基地&mdash;&mdash;东北财经大学产业组织与企业组织研究中心承担编写工作，系东北财经大学产业经济学国家重点学科建设成果之一。本书重视对产业经济学科的全面介绍，内容丰富，取材广泛，总共括十四章，主题涵盖学科流派演变、市场结构分析、企业策略性行为、市场绩效衡量、反垄断与规制政策等，系统反映了现代产业经济学的学科体系和研究成果。本书采用学术界公认的研究观点进行科学阐述，概念准确、论述严密。本书编写生动活泼，书中穿插了大量的案例和思考题，重点阐释了产业经济学理论在现实经济社会中的应用和发展，从而能使读者充分体会到产业经济学学科与现实经济社会生活的紧密结合。</p>\n<p><img id=\"desc-module-5\" class=\"desc_anchor img-ks-lazyload\" src=\"https://assets.alicdn.com/kissy/1.0.0/build/imglazyload/spaceball.gif\" /></p>\n<p><strong><span style=\"color: blue;\">文摘</span></strong></p>\n<p>&nbsp;</p>\n<hr />\n<p>&nbsp;</p>\n<p>暂无相关内容</p>\n<p><br />暂无相关内容<img id=\"desc-module-6\" class=\"desc_anchor img-ks-lazyload\" src=\"https://assets.alicdn.com/kissy/1.0.0/build/imglazyload/spaceball.gif\" /></p>\n<p><strong><span style=\"color: blue;\">作者介绍</span></strong></p>\n<p>&nbsp;</p>\n<hr />\n<p>&nbsp;</p>\n<p>肖兴志，教授，经济学博士，博士生导师。现任东北财经大学副校长，产业经济学国家重点学科带头人，兼任全国产业经济学一级学术团体&mdash;&mdash;中国工业经济学会常务副理事长、学术委员会委员，《产业组织评论》主编。肖兴志教授系享受国务院特殊津贴专家、新世纪人才工程人选、教育部新世纪人才、辽宁省特聘教授，曾荣获教育部高等学校科学研究成果奖，蒋一苇企业改革与发展学术基金论文奖等学术奖励。<br />主要从事产业经济学、规制经济学等领域的研究。主持国家社会科学基金重大招标项目、国家自然科学基金项目、霍英东青年教师基金项目、教育部人文社科重点研究基地重大项目、国家发展和改革委员会公开招标项目等课题研究。出版《产业经济学》、《现代规制经济分析》、《中国煤矿安全规制:理论与实证》、《中国战略性新兴产业发展研究》等专著和教材。在《经济研究》、《管理世界》、《经济学（季刊）》、《中国工业经济》等学术期刊发表多篇论文，其中部分成果被《新华文摘》、《人大复印报刊资料》转载引用。</p>', '2020-10-19 17:23:29', '2020-10-19 17:24:33', '0'), ('1811260', '', '泽平小痘净精露20ml本草精华祛粉刺闭口淡化痘印痘疤痘坑修复男女', '1036048', '1001000', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/dsxk5gw7uye2dudpb68z.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/qe60fdfu2t7f9cx7gfb1.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/wvcqujjewc29inf7n4oa.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/tjnxfgjow4hpknsy3yar.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/fyfhsu5bb0718qisttff.jpg\"]', '护肤品', '护肤品', '1', '122', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/hz657073mqqmr3w6nrkd.jpg', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/wysi4dxu6nesvatdmghu.jpg', '1', '0', '0', '0', '件', '190.00', '168.00', '0.20', null, null, null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/hlcrf853qyy099dbxe22.jpg\" alt=\"\" width=\"790\" height=\"12626\" /></p>', '2020-10-19 17:34:11', '2020-10-23 10:49:42', '0'), ('1811261', '', '人人都是产品经理 ', '1036061', '0', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/rh47y2c2fnafhoij1ob9.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/nzjsm2k35q9nnz7mk3sl.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/zzi7g05cewtouwhlwdp9.jpg\"]', '', '写给产品新人 产品经理培训教程 互联网产品经理书 互联网产品从业者入门手册 创业指导用书籍', '1', '9', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/uuj3ofee37l4c7kld2n8.jpg', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/0snvm1zwsfiklqh3o8ig.jpg', '1', '0', '0', '1', '本', '42.80', '42.80', '0.02', null, null, null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/oiz17u76082iwyhdn0ss.jpg\" alt=\"\" width=\"800\" height=\"800\" /></p>\n<table width=\"100%\" align=\"center\">\n<tbody>\n<tr>\n<td width=\"60%\"><strong><span data-spm-anchor-id=\"a220o.1000855.0.i5.3f0c10a2NlWBDN\">基本信息</span></strong></td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\">\n<tbody>\n<tr>\n<td>\n<div align=\"left\">图书名称：</div>\n</td>\n<td width=\"70%\">\n<div>&nbsp;人人都是产品经理 写给产品新人&nbsp;</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">作 者：</div>\n</td>\n<td>\n<div>&nbsp;苏杰&nbsp;</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"leftt\">定价：</div>\n</td>\n<td>&nbsp;66.60</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">ISBN号：</div>\n</td>\n<td>\n<div>&nbsp;9787121313523</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">出版社：</div>\n</td>\n<td>\n<div>&nbsp;&nbsp;电子工业出版社</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">开本：</div>\n</td>\n<td>\n<div>&nbsp;16</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">装帧：</div>\n</td>\n<td>\n<div>&nbsp;平装</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">出版日期：</div>\n</td>\n<td>\n<div>&nbsp;2017-6-1</div>\n</td>\n</tr>\n<tr>\n<td>\n<div align=\"left\">印刷日期：</div>\n</td>\n<td>\n<div>&nbsp;2017-6-1</div>\n</td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\" align=\"center\">\n<tbody>\n<tr>\n<td width=\"60%\"><strong>编辑推荐</strong></td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\">\n<tbody>\n<tr>\n<td>&radic;产品书越来越多，为何《人人》长期领跑，经典款可以告诉你真相。<br />&radic;累计销售数十万册，伴随互联网产品经理岗位从无到有的启蒙读物。<br />&radic;完整贴心的职业辅导，来自前辈的一线经验，来自名企的产品心得。<br />&radic;全彩思维引导，用视觉描绘一个新人从入职到上位的高效成长历程。</td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\" align=\"center\">\n<tbody>\n<tr>\n<td width=\"60%\"><strong>内容介绍</strong></td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\">\n<tbody>\n<tr>\n<td>《人人都是产品经理&mdash;&mdash;写给产品新人》为经典畅销书《人人都是产品经理》的内容升级版本，和《人人都是产品经理2.0&mdash;&mdash;写给泛产品经理》相当于上下册的关系。对于大量成长起来的优秀互联网产品经理、众多想投身产品工作的其他岗位从业者，以及更多有志从事这一职业的学生而言，这《人人都是产品经理&mdash;&mdash;写给产品新人》曾是他们记忆深刻的启蒙读物、思想基石和行动手册。作者以分享经历与体会为出发点，以&ldquo;朋友间聊聊如何做产品&rdquo;的语气，将自己数年产品工作过程中学到的思维方法与做事方式，及其它们对自己的帮助，系统性地梳理为用户、需求、项目、团队、战略、修养几大话题，完整而生动地回答了&ldquo;我们为什么而做&rdquo;、&ldquo;在做什么事，解决什么人的什么问题&rdquo;、&ldquo;何时，和谁一起做&rdquo;、&ldquo;需要什么能力&rdquo;等人人都要面对的核心问题。<br />《人人都是产品经理&mdash;&mdash;写给产品新人》面向&ldquo;?1到3岁的产品经理&rdquo;，既有知识与方法，也有流程与实战，更有感悟与思考，适合刚入门的产品经理、产品规划师、需求分析师，以及用户体验、市场运营、技术部门的朋友，特别是互联网、软件行业的上述人群，也同样适合对做产品感兴趣的学生。</td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\" align=\"center\">\n<tbody>\n<tr>\n<td width=\"60%\"><strong>作者介绍</strong></td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\">\n<tbody>\n<tr>\n<td>苏杰，浙江大学硕士。<br />2006年至2014年，供职于阿里巴巴集团，一直担任产品经理。<br />在阿里做过中小企业的管理软件、淘宝的卖家工具、淘宝的垂直市场、天猫会员体系/营销工具/大型活动、移动社区类产品等，是集团内在线学习、知识管理平台的搭建者，负责过阿里产品大学、阿里内部的创新孵化器等。此外，供职期间还公示、授权了20多个专利。<br />2015年开始，作者的新身份为良仓孵化器创始合伙人，B12合伙人。<br />截止2017年初，良仓已经是guo家级孵化器、浙江省排名第1的孵化器，累计服务了超过100支创业团队，约40%的团队在孵化期间拿到投资，总金额约3亿人民币。作者在良仓主要负责入驻审核以及入驻团队的辅导。而B12，是一家立足于杭州的科技媒体，同样也是为创业者服务的。<br />作者著有《人人都是产品经理》、《淘宝十年产品事》，创建了网络翻译团队@七印部落，译有《启示录：打造用户喜爱的产品》、《四步创业法》、《有的放矢》等书，乔布斯《遗失的访谈》等视频。<br />作者曾在浙江大学开设《产品经理入门》选修课，是浙江大学MBA嘉宾讲师，多个组织的创业导师，提供产品经理、创业创新相关的培训/咨询服务。</td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\" align=\"center\">\n<tbody>\n<tr>\n<td width=\"60%\"><strong>目录</strong></td>\n</tr>\n</tbody>\n</table>\n<table width=\"100%\">\n<tbody>\n<tr>\n<td>写在正文之前／1<br />为什么会有这本书／1<br />本书的产品定位／3<br />本书的风格与特色／5<br />本书的目录与内容／6<br />我与本书的局限性／8<br />第1章 写给-1到3岁的产品经理／11<br />1.1 为什么要做产品经理／13<br />1.2 我们到底是不是产品经理／20<br />1.3 我真的想做，怎么入行／29<br />1.4 一个产品经理的-1到3岁／34<br />第2章 一个需求的奋斗史／41<br />2.1 从用户中来到用户中去／44<br />2.1.1 用户是需求之源／44<br />2.1.2 你真的了解用户吗／49<br />2.2 需求采集的大生产运动／55<br />2.2.1 定性地说：用户访谈／56<br />2.2.2 定量地说：调查问卷／60<br />2.2.3 定性地做：可用性测试／64<br />2.2.4 定量地做：数据分析／68<br />2.2.5 需求采集人人有责／73<br />2.3 听用户的但不要照着做／78<br />2.3.1 明确我们存在的价值／78<br />2.3.2 给需求做一次DNA检测／82<br />2.4 活下来的永远是少数／93<br />2.4.1 永远忘不掉的那场战争／93<br />2.4.2 别灰心，少做就是多做／100<br />2.5 心急吃不了热豆腐／103<br />第3章 项目的坎坷一生／111<br />3.1 从产品到项目／114<br />3.2 一切从Kick Off开始／118<br />3.3 关键的青春期，又见需求／127<br />3.3.1 真的要写很多文档／127<br />3.3.2 需求活在项目中／140<br />3.4 成长，一步一个脚印／143<br />3.5 山寨级项目管理／155<br />3.5.1 文档只是手段／155<br />3.5.2 流程也是手段／162<br />3.5.3 敏捷更是手段／167<br />3.6 物竞天择适者生存／172<br />3.6.1 亲历过的特色项目／173<br />3.6.2 一路坎坷，你我同行／176<br />第4章 我的产品，我的团队／183<br />4.1 大产品，大设计，大团队／186<br />4.1.1 产品之大／186<br />4.1.2 设计之大／190<br />4.1.3 团队之大／196<br />4.2 游走于商业与技术之间／201<br />4.2.1 心思缜密的规划师／202<br />4.2.2 激情四射的设计师／205<br />4.2.3 &ldquo;阴险狡诈&rdquo;的运营师／215<br />4.3 商业团队，冲锋陷阵／221<br />4.3.1 好产品还需市场化／222<br />4.3.2 我们还能做什么／229<br />4.4 技术团队，坚强后盾／234<br />4.5 容易被遗忘的角落／237<br />4.6 大家好才是真的好／240<br />4.6.1 所谓团队文化／240<br />4.6.2 虚无的无授权领导／242<br />第5章 别让灵魂跟不上脚步／249<br />5.1 触及产品的灵魂／251<br />5.2 可行性分析三部曲／256<br />5.2.1 我们在哪儿／256<br />5.2.2 我们去哪儿／259<br />5.2.3 我们怎么去／263<br />5.3 做吧，准备出发／265<br />5.3.1 敢问路在何方／265<br />5.3.2 低头走路，抬头看天／268<br />5.4 KPI，KPI，KPI／272<br />5.5 本书的源头活水／277<br />第6章 产品经理的自我修养／279<br />6.1 爱生活，才会爱产品／282<br />6.2 有理想，就不会变咸鱼／286<br />6.3 会思考，活到老学到老／291<br />6.4 能沟通，在什么山头唱什么歌<br />6.5 产品经理主义／302<br />附录A：它山之石 可以攻玉／315<br />别人眼中的产品经理／315<br />各种有用的信息／320</td>\n</tr>\n</tbody>\n</table>', '2020-10-20 08:40:54', '2020-10-21 10:18:25', '0'), ('1811262', '', '正版 人大版 公共经济学高培勇 第三版3版 中国人民大学出版社 高培勇', '1036046', '0', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/nug2ihhzedscb54e1ywf.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/9p1l6dpwr6sz0lcnfrzu.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/msx26116uyrkf95hrs7c.jpg\"]', '', '', '1', '803', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/hcg47hl50bn2payaz4x3.jpg', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/zlpm91o2zqx6m2hg2wsd.jpg', '1', '0', '0', '1', '本', '36.00', '27.00', '0.10', null, null, null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/67zkrrnq8qrmh24zcayp.jpg\" alt=\"\" width=\"810\" height=\"5402\" /></p>', '2020-10-20 08:44:10', '2020-10-20 08:44:11', '0'), ('1811263', '', '正版 金融学原理 第六版 当代经济学教学参考书系', '1036046', '0', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/v0at4r2cifrojntbamwl.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/z4guda6c5g5qa4ti6thm.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/be10j7rbiactmk1pf661.jpg\"]', '', '金融学基础大学本科在职研究生金融从业人员金融学入门级教材', '1', '803', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/9u763pimtn5worj15z6z.jpg', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/mz7dq2igpk9mp8te6pn1.jpg', '1', '0', '0', '1', '本', '72.00', '45.00', '0.10', null, null, null, '<div>\n<div>\n<div><span data-spm-anchor-id=\"a220o.1000855.0.i1.2b934bc7HFtdcw\">适读人群 ：高等院校经济学、金融学等专业的本科生，研究生以及对金融感兴趣的一般读者<br />&middot;新增行为金融方面的知识，以反映投资者心理和情绪对风险资产定价的影响。<br />&middot;根据中国新确立的监管体制，将原来分别介绍的&ldquo;中国银行业监督管理委员会&rdquo;和&ldquo;中国保险业监督管理委员会&rdquo;融为了&ldquo;中国银行保险业监督管理委员会&rdquo;。<br />&middot;增加了对&ldquo;亚洲基础设施投资银行&rdquo;和&ldquo;金砖银行&rdquo;的介绍，以更全面地反映国际金融组织参与中国金融体系的活动。<br />&middot;鉴于过去几年里，诸如坊间戏称的&ldquo;麻辣粉&rdquo;（中期借贷便利）等中国货币政策工具体系不断得到创新、央行建立和扩充了再贷款的合格抵押品管理框架、货币政策功能的扩展等，将原来的&ldquo;货币政策&rdquo;一章分成了&ldquo;货币政策：目标与工具体系&rdquo;和&ldquo;货币政策：传导机制与政策哲学&rdquo;两章的内容，以便于读者更全面地理解和掌握中国货币政策，并理解其对宏观经济和金融体系的影响。</span></div>\n</div>\n</div>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p>本书自2003年初版以来，已历经五次修订。掐指算来，本书初版的读者已届而立之年，中国金融体系也从初版之时的探索逐渐走向了成熟，一个现代化的金融体系架构业已成形。尤其是，自第五版以来的六年左右时间里，中国金融体系经历了较明显的变革，中国不仅已成为了全球第三大债券市场，利率市场化已初步完成，人民币汇率机制也今非昔比，人民币汇率双向波动更加明显，货币政策工具不断得到创新、丰富和发展，外汇储备规模下降直接左右了货币政策工具体系的应用，防范和化解金融风险成为了宏观经济政策蕞重要的内容之一，金融开放向纵深推进，是故，金融监管体系也得到了重塑，宏观审慎理念和实践在深入发展，穿透式监管和功能监管在纷繁的金融创新中得到确立。凡此种种新变化和新发展，都在第六版的修订中的相应章节得到了反映。</p>\n<p>&nbsp;</p>\n<p>第一篇 总论</p>\n<p>第1章 货币</p>\n<p>第2章 金融系统</p>\n<p>第3章 货币的时间价值</p>\n<p>第4章 资源的时间配置：储蓄与消费的选择</p>\n<p>第5章 资金选择与定价</p>\n<p>第6章 资金短缺者的融资选择</p>\n<p>第二篇 机构与市场</p>\n<p>第7章 金融机构与市场组织</p>\n<p>第8章 商业银行业务与管理</p>\n<p>第9章 长期资本市场</p>\n<p>第10章 货币市场</p>\n<p>第11章 外汇市场</p>\n<p>第12章 金融衍生品市场</p>\n<p>第三篇 金融调控</p>\n<p>第13章 货币供给</p>\n<p>第14章 货币需求</p>\n<p>第15章 利率水平与利率结构</p>\n<p>第16章 物价水平：通货膨胀与通货紧缩</p>\n<p>第17章 汇率的决定与汇率制度</p>\n<p>第18章 国民收入与产出的决定</p>\n<p>第19章 货币政策：目标与工具</p>\n<p>第20章 货币政策：传导机制与政策哲学</p>\n<p>第四篇 金融发展与稳定</p>\n<p>第21章 金融发展与金融结构</p>\n<p>第22章 金融深化与金融自由化</p>\n<p>第23章 金融危机</p>\n<p>第24章 金融监管</p>\n<p>术语表</p>', '2020-10-20 08:50:22', '2020-10-20 08:50:23', '0'), ('1811264', '', '精益创业:新创企业的成长思维 埃里克 莱斯 著 精益创业2.0 中信出版社图书 畅销书 正版书籍', '1036046', '0', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/f5x414tzn38bkqz6vocj.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/k2y9ppybhmkutzq78m5x.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/2don46dngdwfmek79t2m.jpg\"]', '', '新创企业的成长思维', '1', '102', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/w57h9so5xlyj1jml2p5q.jpg', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/psqrdozgc0gcpadffzob.jpg', '1', '0', '0', '1', '本', '24.50', '24.50', '0.02', null, null, null, '<p data-spm-anchor-id=\"a220o.1000855.0.i2.2efd23c1cKGkMc\"><strong><span style=\"color: #ff6600;\" data-spm-anchor-id=\"a220o.1000855.0.i5.2efd23c1cKGkMc\">精益创业代表了一种不断形成创新的新方法，它源于&ldquo;精益生产&rdquo;的理念，提倡企业进行&ldquo;验证性学习&rdquo;，先向市场推出极简的原型产品，然后在不断地试验和学习中，以小的成本和有效的方式验证产品是否符合用户需求，并迭代优化产品，灵活调整方向。</span></strong></p>\n<p data-spm-anchor-id=\"a220o.1000855.0.i3.2efd23c1cKGkMc\">图书有白色封面和蓝色封面2个版本，库房随机发货</p>\n<p data-spm-anchor-id=\"a220o.1000855.0.i3.2efd23c1cKGkMc\"><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/434xe8t6m09i4w4qc37q.jpg\" alt=\"\" width=\"350\" height=\"350\" /></p>\n<p style=\"text-align: left;\"><span data-spm-anchor-id=\"a220o.1000855.0.i6.2efd23c1cKGkMc\">书名：精益创业</span></p>\n<p style=\"text-align: left;\">原价：49.00元</p>\n<p style=\"text-align: left;\">作者：[美] 埃里克&bull;莱斯 （Eric Ries）</p>\n<p style=\"text-align: left;\">出版日期：2012年7月</p>\n<p style=\"text-align: left;\">页码：272页</p>\n<p style=\"text-align: left;\">开本：16</p>\n<p style=\"text-align: left;\">装帧：精装</p>\n<p style=\"text-align: left;\">ISBN:9787508622019</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p><img class=\"img-ks-lazyload\" src=\"https://img.alicdn.com/imgextra/i3/832978172/T2kTNFXlFNXXXXXXXX_!!832978172.jpg\" /></p>\n<p>精益创业的思想已经成为一项运动在全球蓬勃发展起来，在全球100多个多家都有组织起来的精益创业实践社团。</p>\n<p>&nbsp;&nbsp;&nbsp; 精益创业思想在中国已经具有一定的影响力，许多创业沙龙和投资人都组织学习或推荐<br />▲ @ techyizu 、@创业周末 @凌代鸿@刘锋Frank等创业组织和创业沙龙和投资人微博推荐过精益创业的模式<br />▲ 英文版豆瓣评分8.9分<br />▲ 目前国内国内出版了一些关于创业企业的管理书籍，但是系统化的管理思想很少。</p>\n<p style=\"text-align: left;\"><img id=\"desc-module-3\" class=\"desc_anchor img-ks-lazyload\" src=\"https://assets.alicdn.com/kissy/1.0.0/build/imglazyload/spaceball.gif\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img class=\"img-ks-lazyload\" src=\"https://img.alicdn.com/imgextra/i3/832978172/T2V9lWXjVdXXXXXXXX_!!832978172.jpg\" data-spm-anchor-id=\"a220o.1000855.0.i0.2efd23c1cKGkMc\" /></p>\n<p style=\"text-align: left;\">引 言 // IX<br />第一篇 愿景<br />第一章 开端 // 003<br />创业管理 // 003<br />精益创业的根基 // 006<br />第二章 定义 // 012<br />谁才是创业企业家？ // 012<br />如果我是创业者，何谓新创企业？ // 014<br />SnapTax 的故事 // 015<br />七千人的精益创业 // 017<br />第三章 学习 // 022<br />IMVU经证实的认知 // 023<br />价值VS浪费 // 030<br />从何证实？ // 032<br />零的愚勇 // 034<br />IMVU之外的启示 // 036<br />第四章 实验 // 038<br />从点金术到科学 // 038<br />实验也是产品 // 044<br />乡村洗衣服务 // 046<br />政府部门中的精益创业？ // 048<br />第二篇 驾驭<br />第五章 飞跃 // 058<br />战略基于假设 // 059<br />现地现物 // 064<br />走出办公大楼 // 065<br />分析瘫痪症 // 067<br />第六章 测试 // 069<br />为什么第一个产品不完美 // 071<br />视频式最小化可行产品 // 073<br />贵宾式最小化可行产品 // 075<br />别在意那八个幕后人员 // 078<br />质量和设计在最小化可行产品中的角色 // 081<br />开发最小化可行产品中的减速路障 // 084<br />从最小化可行产品到创新核算 // 087<br />第七章 衡量 // 089<br />为什么看似枯燥的核算将改变你的生活 // 089<br />如何实行创新核算&mdash;&mdash;三大认知阶段性目标 // 091<br />IMVU的创新核算 // 094<br />优化VS认知 // 098<br />小心虚荣指标 // 100<br />可执行指标VS虚荣指标 // 101<br />三个&ldquo;可&rdquo;的价值 // 112<br />第八章 转型还是坚持 // 117<br />创新核算带来更迅速的转型 // 118<br />能实现的转型数量决定新创公司的跑道 // 126<br />转型需要勇气 // 127<br />&ldquo;转型还是坚持&rdquo;的会议 // 129<br />转型失败 // 133<br />转型列表 // 136<br />转型是一个战略假设 // 139<br />第三篇 加速<br />第九章 批量 // 146<br />创业活动中的小批量 // 149<br />小批量的实例 // 152<br />大批量的死亡螺旋 // 155<br />要拉动，不要推动 // 157<br />第十章 成长 // 163<br />增长来自何方？ // 164<br />三种增长引擎 // 165<br />增长引擎决定产品/ 市场契合 // 174<br />引擎停滞之时 // 176<br />第十一章 适应 // 178<br />建立自适应组织 // 180<br />&ldquo;五个为什么&rdquo;的智慧 // 182<br />五大罪状之魔咒 // 186<br />五个为什么的实例 // 190<br />适应较小的批量 // 195<br />第十二章 创新 // 202<br />如何培养颠覆式创新 // 202<br />创造实验平台 // 205<br />培养管理组合 // 211<br />第十三章 尾声：杜绝浪费 // 217<br />组织的超能力 // 220<br />长期股票交易中心 // 225<br />总结 // 226<br />第十四章 参与精益创业运动 // 227<br />必修读物 // 228<br />沿展阅读 // 230<br />致谢 // 233</p>\n<p>&nbsp;</p>\n<p style=\"text-align: left;\">&nbsp;</p>\n<p><img class=\"img-ks-lazyload\" src=\"https://img.alicdn.com/imgextra/i2/832978172/T237p2XoxcXXXXXXXX_!!832978172.jpg\" /></p>\n<p><span style=\"color: #000000;\">我们正处在一个全球创业兴盛时代，但无数创业公司都黯然收场，以失败告终。对于新创企业，传统的管理思维并不适用，所以新一代的创业者需要找到建立成功企业的新思路。精益创业代表了一种不断形成创新的新方法，它源于&ldquo;精益生产&rdquo;的理念，提倡企业进行&ldquo;验证性学习&rdquo;，先向市场推出极简的原型产品，然后在不断地试验和学习中，以*小的成本和有效的方式验证产品是否符合用户需求，并迭代优化产品，灵活调整方向。这一模式不仅针对车库创业派，对于全球*大企业内部的新创业务也同样适用。</span></p>\n<p><span style=\"color: #000000;\">创业</span><span style=\"color: #000000;\">是在充满不确定性的情况下进行产品或服务创新。新创企业还不知道他们的产品应该是什么样的，他们的顾客在哪里。计划和预测只能基于长期、稳定的运营历史和相对静止的环境。而这些条件新创企业都不具备。有时候我们自己觉得产品会非常受欢迎，所以花费巨大精力，在各种细小的问题上进行打磨，结果，产品推到市场后，消费者很残酷地表示他们不需要这个东西。如果我们的生意本身不被市场需要，那么我们失败来的越快越好，这意味着我们耗费更少的资金和精力在错误的事情上。</span></p>\n<div>\n<table style=\"height: 100px;\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\n<tbody>\n<tr style=\"height: 100px;\">\n<td style=\"height: 100px;\" align=\"left\" valign=\"top\">\n<p><span style=\"color: #000000;\">埃里克将精益创业提炼为一个反馈循环：想法&mdash;开发&mdash;测量&mdash;认知&mdash;新的想法。根据这种模式，我们创业是把想法变为产品，而且这时开发的产品是精简的原型，投入小的金钱和精力开发出体现核心价值的产品，不要在许多细枝末节上耗费过多精力。当极简功能的产品用户认可后，创业者需要把控局势，在不断的反馈和循环中测试产品，及时作出调整和改变，迭代优化产品，挖掘用户需求，达到爆发式增长。新创企在消耗完启动资金之前，以小的成本、在短时间里找到有价值的认知。</span></p>\n</td>\n</tr>\n</tbody>\n</table>\n</div>\n<p>&nbsp;</p>\n<p style=\"text-align: left;\"><img id=\"desc-module-5\" class=\"desc_anchor img-ks-lazyload\" src=\"https://assets.alicdn.com/kissy/1.0.0/build/imglazyload/spaceball.gif\" /></p>\n<p>&nbsp;</p>\n<p>&nbsp;</p>\n<p><img class=\"img-ks-lazyload\" src=\"https://img.alicdn.com/imgextra/i4/832978172/T2MeqLXhRaXXXXXXXX_!!832978172.jpg\" align=\"absmiddle\" /></p>\n<p>作者简介：（美国）埃里克&bull;莱斯 译者：吴桐<br /><br />埃里克&bull;莱斯,IMUV联合创始人及CTO，哈佛商学院驻校企业家，其&ldquo;精益创业&rdquo;的理念被《纽约时报》、《华尔街日报》、《哈佛商业评论》、《赫芬顿邮报》等多家媒体广泛报道。他还为多家新创企业、大型公司及风险投资公司提供商业及产品战略方面的咨询服务。</p>', '2020-10-20 09:10:44', '2020-10-20 09:10:45', '0'), ('1811265', '', '西方经济学 第七版 宏观部分+微观部分 高鸿业', '1036046', '0', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/qbfqx0etfshi31fs0o7v.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/t71qrfi1dy0lplar75a4.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/0wgnc6ny5d6ni6tmnrsk.jpg\"]', '', '西方经济学高鸿业第7版 考研教材 经管经济学教材中国人民大学出版', '1', '803', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/erw1zwybi0iwobg3zivf.jpg', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.com/5ozztev2oo2b6w40vglz.jpg', '1', '0', '0', '1', '本', '84.00', '59.00', '0.10', null, null, null, '<p><img src=\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/w4tqxg2yc88c5kyqjzb3.jpg\" alt=\"\" width=\"810\" height=\"5705\" /></p>', '2020-10-20 09:11:27', '2020-10-20 09:11:28', '0'), ('1811266', '', '俄罗斯进口kdv糖果kpokaht紫皮糖夹心巧克力零食礼包喜糖年货食品', '1036062', '1001010', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/3izhn9kprswjanjo0wex.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/g7v6g9k1le3omiomyaxt.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/jrkttm35v2vmftzc5fju.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/rwcgani8whngipp8mj0j.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/almlk3dh86xdq8r5bsyz.jpg\"]', '巧克力', '巧克力', '1', '126', 'https://devapis.oss-cn-zhangjiakou.aliyuncs.