02', null, null, null, '<p>前言<br />导论<br />*章 简要论证：一些基本规则<br />规则1 确定前提和结论<br />规则2 理顺你的思路<br />规则3 从可靠的前提出发<br />规则4 具体、简明<br />规则5 依靠实际内容，而非过激言论<br />规则6 措辞前后一致<br />第二章 概括<br />规则7 不要只举一个例子<br />规则8 使用有代表性的例子<br />规则9 事件发生的概率或许至关重要<br />规则10 慎重对待统计数字<br />规则11 考虑反例证<br />第三章 类比论证<br />规则12 类比中的例证必须在本质上相似<br />第四章 信息来源<br />规则13 列出信息来源<br />规则14 寻找可靠的消息人士<br />规则15 寻找公正的信息来源<br />规则16 从多方面核实信息来源<br />规则17 慎用网络<br />第五章 因果论证<br />规则18 因果论证始于关联<br />规则19 一种关联可能有多种解释<br />规则20 向着可能性*的解释努力<br />规则21 情况有时很复杂<br />第六章 演绎论证<br />规则22 肯定前件式(Modus ponens)<br />规则23 否定后件式(Modus tollens)<br />规则24 假言三段论(Hypothetical syllogism)<br />规则25 选言三段论(DiSjunetive syllogism)<br />规则26 二难推理(Dilemma)<br />规则27 归谬法(Reductio ad absurdum)<br />规则28 多步骤演绎论证<br />第七章 详细论证<br />规则29 研究话题<br />规则30 把基本观点按照论证的形式写出来<br />规则31 对基本前提进行专门的论证<br />规则32 考虑反对意见<br />规则33 考虑其他解决方法<br />第八章 议论文<br />规则34 开门见山<br />规则35 提出明确的主张或建议<br />规则36 你的论证就是你的提纲<br />规则37 详细介绍反对意见，设法反驳<br />规则38 搜集和利用反馈信息<br />规则39 请你谦虚点<br />第九章 口头论证<br />规则40 打动你的听众<br />规则41 使自己充满现场感<br />规则42 给你的论证设置路标<br />规则43 说话要积极<br />规则44 少用视觉辅助<br />规则45 结尾要有气派<br />附录一 一些常见的谬误<br />附录二 定义</p>\n<p>*章至第六章讨论如何构建和评估简要论证。简要论证只是简单地提出理由和证据，通常只有几句话或一个段落。我们从简要论证开始是出于以下几个原因。首先，它们很常见：实际上它们极其常见，是人们日常对话的一部分。其次，较长的论证通常是对简要论证的详细说明。或者是将一系列简要论证连在一起。如果你首先学习书写和评估简要论证，那么你就能够把这项技能加以扩展，处理议论文或口头陈述中的详细论证。<br />&hellip;&hellip;<br />第七章带你从整体到局部地研究详细论证，同时你需要思考反对意见和其他可能性。第八章带你从上一步进入议论文写作。然后，第九章补充一些针对口头陈述的规则。同样，所有这些章节都以前六章为基础，因为像这样的详细论证本质上是对前六章讨论的简要论证进行组合和详细说明。&hellip;&hellip;<br />本书结尾有两个附录。附录一列举了各种谬误：这些使人产生误解的论证是如此地迷惑人、如此地常见，它们甚至有自己的名字。附录二提供了构建和评估定义的三个规则。在需要使用它们的时候就请使用吧！</p>', '2020-10-20 11:14:22', '2020-10-23 10:05:03', '0'), ('1811277', '', '椰子角椰子肉500g有嚼头海南特产椰肉泰国风味椰子片包邮果干蜜饯', '1036062', '1001012', '[\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/t3oa4wahl1110016o1c2.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/9j898ccoo6055ayj7lvn.jpg\",\"https://devapis.oss-cn-zhangjiakou.aliyuncs.com/vv6km7bedle32t2i8s9o.jpg\",\"https://devapis.oss-cn-zhangjia